/*
    Component to retrieve the Sales from the QuickBooks API
    Prints the most recent 25 sales from the sandbox
    @Notes: Lyka Marcelino, 04/04/2020
 */

import React from 'react';
const newblock = {
    backgroundColor: "whitesmoke",
    borderRadius: "50px",
    display: "block",
    width: "700px",
    height: "500px",
    marginLeft: "500px",
    marginTop: "50px",
    alignContent: "center"
}

export default class GraphForm extends React.Component {
    render() {
        return(<div style={newblock}>hello</div> );
    }
}
